#include "bsp_lcd.h"

static const char *TAG = "bsp_lcd";


esp_lcd_panel_handle_t lcd_panel = NULL;

esp_err_t  bsp_lcd_init(void)
{
    /* Init TCA9554 -> turn on backlight */
    ESP_ERROR_CHECK(tca9554_init());
    ext_io_t io_conf = BSP_EXT_IO_DEFAULT_CONFIG();
    ext_io_t io_level = BSP_EXT_IO_DEFAULT_LEVEL();
    ESP_ERROR_CHECK(tca9554_set_configuration(io_conf.val));
    ESP_ERROR_CHECK(tca9554_write_output_pins(io_level.val));

    ESP_LOGI(TAG, "Initialize LCD Intel 8080 bus");
    esp_lcd_i80_bus_handle_t i80_bus = NULL;
    esp_lcd_i80_bus_config_t bus_config = {
        .dc_gpio_num = GPIO_LCD_RS,
        .wr_gpio_num = GPIO_LCD_WR,
        .data_gpio_nums = {
            GPIO_LCD_D00, GPIO_LCD_D01, GPIO_LCD_D02, GPIO_LCD_D03, 
            GPIO_LCD_D04, GPIO_LCD_D05, GPIO_LCD_D06, GPIO_LCD_D07, 
            GPIO_LCD_D08, GPIO_LCD_D09, GPIO_LCD_D10, GPIO_LCD_D11,
            GPIO_LCD_D12, GPIO_LCD_D13, GPIO_LCD_D14, GPIO_LCD_D15,
        },
        .bus_width = LCD_BIT_WIDTH,
        .max_transfer_bytes = LCD_WIDTH * 40 * sizeof(uint16_t)    //最大32640 *2, 受DMA限制 
    };
    ESP_ERROR_CHECK(esp_lcd_new_i80_bus(&bus_config, &i80_bus));

    esp_lcd_panel_io_handle_t io_handle = NULL;
    esp_lcd_panel_io_i80_config_t io_config = {
        .cs_gpio_num = GPIO_LCD_CS,
        .pclk_hz = 6000000, // 测试14MHz以上花屏 10MHZ=26.18fps   13MHZ=34.04fps
        .trans_queue_depth = 10,
        .dc_levels = {
            .dc_idle_level = 0,
            .dc_cmd_level = 0,
            .dc_dummy_level = 0,
            .dc_data_level = 1,
        },
        // .on_color_trans_done = example_notify_lvgl_flush_ready,  //Callback invoked when color data transfer has finished
        // .user_ctx = &disp_drv,                                   //User private data, passed directly to on_color_trans_done’s user_ctx
        .lcd_cmd_bits = 16,
        .lcd_param_bits = 16,
    };
    ESP_ERROR_CHECK(esp_lcd_new_panel_io_i80(i80_bus, &io_config, &io_handle));

    ESP_LOGI(TAG, "Install LCD driver of rm68120");
    
    esp_lcd_panel_dev_config_t panel_config = {
        .reset_gpio_num = GPIO_LCD_RST,
        .color_space = ESP_LCD_COLOR_SPACE_RGB,
        .bits_per_pixel = 16,
    };
    ESP_ERROR_CHECK(esp_lcd_new_panel_rm68120(io_handle, &panel_config, &lcd_panel));

    esp_lcd_panel_reset(lcd_panel);   // LCD Reset
    esp_lcd_panel_init(lcd_panel);    // LCD init
    // esp_lcd_panel_swap_xy(lcd_panel, true);
    // esp_lcd_panel_mirror(lcd_panel, true, false);

    lcd_clear_fast(lcd_panel, COLOR_WHITE);
    // lcd_draw_picture_test(lcd_panel);
    // lcd_speed_test(lcd_panel);

    return ESP_OK;
}

esp_err_t lcd_clear(esp_lcd_panel_t *panel, uint16_t color)
{
    lcd_panel_t *rm68120 = __containerof(panel, lcd_panel_t, base);

    uint16_t *buffer = heap_caps_malloc(rm68120->width * sizeof(uint16_t), MALLOC_CAP_INTERNAL | MALLOC_CAP_8BIT);
    if (NULL == buffer) {
        ESP_LOGE(TAG, "Memory for bitmap is not enough");
        return ESP_FAIL;
    } else {
        for (uint16_t i = 0; i < rm68120->width; i++) {
            buffer[i] = color;
        }
        for (int y = 0; y < rm68120->height; y++) {
            esp_lcd_panel_draw_bitmap(panel, 0, y, rm68120->width, y+1, buffer);
        }
        heap_caps_free(buffer);
    }
    return ESP_OK;
}

esp_err_t lcd_clear_fast(esp_lcd_panel_t *panel, uint16_t color)
{
    lcd_panel_t *rm68120 = __containerof(panel, lcd_panel_t, base);
    ESP_LOGD("lcd_debug", "%dx%d", rm68120->width, rm68120->height);
    // uint64_t s = esp_timer_get_time();
    uint16_t *buffer = heap_caps_malloc(rm68120->width * 40 * sizeof(uint16_t), MALLOC_CAP_INTERNAL | MALLOC_CAP_8BIT);
    if (NULL == buffer) {
        ESP_LOGE(TAG, "Memory for bitmap is not enough");
        return ESP_FAIL;
    } else {
        for (uint16_t i = 0; i < rm68120->width * 40; i++) {
            buffer[i] = color;
        }
        for (int y = 0; y < rm68120->height; y += 40) {
            esp_lcd_panel_draw_bitmap(panel, 0, y, rm68120->width, y+40, buffer);
        }
        heap_caps_free(buffer);
    }
    // uint64_t t1 = (esp_timer_get_time() - s);
    // float time_per_frame = t1 / 1000;   
    // float fps = 1000000.f / (float)t1;
    // ESP_LOGI(TAG, "@resolution %ux%u  [time per frame=%.2fMS, fps=%.2f]", rm68120->width, rm68120->height, time_per_frame, fps);
    return ESP_OK;
}
esp_err_t lcd_clear_icon_area(esp_lcd_panel_t *panel, uint16_t color)
{
    lcd_panel_t *rm68120 = __containerof(panel, lcd_panel_t, base);
    ESP_LOGD("lcd_debug", "lcd_clear_icon_area:%dx%d", 160, rm68120->height);
    uint16_t *buffer = heap_caps_malloc(160 * 40 * sizeof(uint16_t), MALLOC_CAP_INTERNAL | MALLOC_CAP_8BIT);
    if (NULL == buffer) {
        ESP_LOGE(TAG, "Memory for bitmap is not enough");
        return ESP_FAIL;
    } else {
        for (uint16_t i = 0; i < 160 * 40; i++) {
            buffer[i] = color;
        }
        for (int y = 0; y < rm68120->height; y += 40) {
            esp_lcd_panel_draw_bitmap(panel, 640, y, 800, y+40, buffer);
        }
        heap_caps_free(buffer);
    }
    return ESP_OK;
}

uint16_t rgb888_to_565(uint8_t r, uint8_t g, uint8_t b)
{
    return ((r & 0xF8) << 8) | ((g & 0xFC) << 3) | (b >> 3);
}

const uint16_t sky_animation_mask[];   //200*100
//static const unsigned char gImage_img_640_12[];
void lcd_draw_picture_t(esp_lcd_panel_t *panel)
{
    uint16_t *pixels = heap_caps_malloc((200 * 100) * sizeof(uint16_t), MALLOC_CAP_8BIT | MALLOC_CAP_INTERNAL);
    memcpy(pixels, sky_animation_mask, (200 * 100) * sizeof(uint16_t));
    
    esp_lcd_panel_draw_bitmap(panel, 300, 200, 300+200, 200+100, (uint16_t *)pixels);
    heap_caps_free(pixels);
}

