void lcd_speed_test(esp_lcd_panel_t *panel)
{
    lcd_panel_t *rm68120 = __containerof(panel, lcd_panel_t, base);

    uint32_t w = 240, h = 136;  //136 ok  137 ng

    const uint32_t buffer_size = w * h;
    uint16_t *pixels = heap_caps_malloc(buffer_size * sizeof(uint16_t), MALLOC_CAP_8BIT | MALLOC_CAP_INTERNAL);

    const uint16_t color_table[] = {COLOR_RED, COLOR_GREEN, COLOR_BLUE, COLOR_YELLOW};
    uint32_t times = 256;

    uint64_t s;
    uint64_t t1 = 0;
    for (int i = 0; i < times; i++) {
        for (int j = 0; j < buffer_size; j++) {
            pixels[j] = color_table[i % 4];
        }
        s = esp_timer_get_time();
        esp_lcd_panel_draw_bitmap(panel, 0, 0, w, h, (uint16_t *)pixels);
        t1 += (esp_timer_get_time() - s);
    }
    t1 = t1 / 1000;
    float time_per_frame = (float)t1 / (float)times;
    float fps = (float)times * 1000.f / (float)t1;
    float write_speed = sizeof(uint16_t) * buffer_size * times / 1024.0f / 1.0240f / (float)t1;
    float factor = ((float)w * (float)h) / ((float)rm68120->width * (float)rm68120->height);
    ESP_LOGI(TAG, "-------Test Result------");
    if (w != rm68120->width || h != rm68120->height) {
        ESP_LOGI(TAG, "@resolution 240x136          [time per frame=%.2fMS, fps=%.2f, speed=%.2fMB/s]", time_per_frame, fps, write_speed);
        ESP_LOGI(TAG, "@resolution %ux%u infer to [time per frame=%.2fMS, fps=%.2f]",
                 rm68120->width, rm68120->height,
                 time_per_frame / factor, factor * fps);
    } else {
        ESP_LOGI(TAG, "@resolution %ux%u          [time per frame=%.2fMS, fps=%.2f, speed=%.2fMB/s]", rm68120->width, rm68120->height, time_per_frame, fps, write_speed);
    }
    ESP_LOGI(TAG, "-------------------------------------");

    heap_caps_free(pixels);
}



